SELECT COUNT(*) as agg_0, MAX("movie_info_idx"."info_type_id") as agg_1 FROM "movie_info_idx" LEFT OUTER JOIN "info_type" ON "movie_info_idx"."info_type_id" = "info_type"."id" LEFT OUTER JOIN "title" ON "movie_info_idx"."movie_id" = "title"."id"  WHERE "title"."title" LIKE '%Part%' AND "movie_info_idx"."info_type_id" != 101 AND "movie_info_idx"."info" NOT LIKE '%7.9%' AND "title"."season_nr" BETWEEN 4.19383858869042 AND 1920.4263313625256 AND "info_type"."info" NOT LIKE '%video%';